import React from 'react';
import { MdMenu } from "react-icons/md";
import './header.css'
const Header = () => {
  return (
    <header className="header">
      <MdMenu color="#fff" fontSize="30px" cursor="pointer"/>
    </header>
  );
}

export default Header;
